    false,nt"url": null,nt"notes": "Horicon Marsh, Central Wisconsin, and Crex
    Meadows were studied during spring and summer 1999 to assess suitability as reintroduction
    sites for the endangered whooping crane. This report summarizes abundance of potential
    aquatic animal food items at each of these sites. Sampling occurred at Horicon National
    Wildlife Refuge and Horicon Wildlife Area (Horicon Marsh); Necedah National Wildlife
    Refuge, Sandhilll Wildlife Area, Meadow Valley Wildlife Area, and cranberry properties
    near Mather and Cranmoor (Central Wisconsin); and at Crew Meadows Wildlife Area
    (Crex Meadows). Data for crane habitat at Seney National Wildlife Refuge, Upper
    Michigan, were also collected for comparison.This report appears as Appendix 3 in
    J. R. Cannon. 1999. Wisconsin whooping crane breeding site assessment. Final Report
    to the Canadian-U.S. Whooping Crane Recovery Team, Front Royal, Virginia.",nt"license_title":
